// SPDX-License-Identifier: MIT
pragma solidity ^0.8.25;

contract votingDapp{

bool public VotingProgress;

    struct Vote{
        address receiverAdress;
        uint256 timestamp;
    }
    mapping(address=>Vote)public votes;

    //In this section are the events

    event AddVote(address indexed voter, address receiverAdress, uint256 timestamp);
    event RemoveVote(address voter);
    event StartVoting(address startedBy);
    event StopVoting(address stoppedBy);

    constructor() {
        VotingProgress=false;
    }

    function startVoting() external returns(bool){
        VotingProgress=true;
        emit StartVoting(msg.sender);
        return true;
    }

    function stopVoting() external returns(bool){
        VotingProgress=false;
        emit StopVoting(msg.sender);
        return true;
    }

    function addVote(address receiverAdress) external returns(bool){
        votes[msg.sender].receiverAdress=receiverAdress;
        votes[msg.sender].timestamp=block.timestamp;

        emit AddVote(msg.sender, votes[msg.sender].receiverAdress, votes[msg.sender].timestamp);
        return true;
    }

    function removeVote() external returns(bool){
        delete votes[msg.sender];

        emit RemoveVote(msg.sender);
        return true;

    }

    function getVote(address voterAddress) external view returns(address candidateAddress){
        return votes[voterAddress].receiverAdress;
    }

}

